import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';

function ChangeName(user) {
  user.fName += ' Pejpej';
  return user.fName + ' ' + user.lName;
}

const user = {
  fName: 'Herpes',
  lName: 'Popz'
};

const element = <h1>Hello, {ChangeName(user)}</h1>;

ReactDOM.render(
  //<React.StrictMode>
  //  <App />
